import React, { useState, useEffect } from 'react';

const Review = () => {
  const [reviews, setReviews] = useState([]);
  const [user, setUser] = useState('');
  const [rating, setRating] = useState(0);
  const [comment, setComment] = useState('');

  useEffect(() => {
    fetch('/reviews')
      .then(response => response.json())
      .then(data => setReviews(data));
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();
    const review = { user, rating, comment };

    fetch('/reviews', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(review)
    })
      .then(response => response.json())
      .then(data => setReviews([...reviews, data]));

    setUser('');
    setRating(0);
    setComment('');
  };

  return (
    <div>
      <header>
        <div className="container">
          <h2 className="title">Reviews</h2>
        </div>
      </header>
      <div className="container">
        <div className="review-list">
          {reviews.map((review, index) => (
            <div key={index} className="review-item">
              <h5 className="title"><span>{review.user}</span></h5>
              <div className={`stars stars-${review.rating}`}></div>
              <p className="align-center">{review.comment}</p>
            </div>
          ))}
        </div>
        <div className="add-review">
          <h3>Add a Review</h3>
          <form onSubmit={handleSubmit}>
            <label>User:</label><br />
            <input type="text" value={user} onChange={(e) => setUser(e.target.value)} /><br />
            <label>Rating:</label><br />
            <div className="star-rating">
              <div className={`stars stars-${rating}`} onClick={() => setRating(1)}></div>
              <div className={`stars stars-${rating}`} onClick={() => setRating(2)}></div>
              <div className={`stars stars-${rating}`} onClick={() => setRating(3)}></div>
              <div className={`stars stars-${rating}`} onClick={() => setRating(4)}></div>
              <div className={`stars stars-${rating}`} onClick={() => setRating(5)}></div>
            </div><br />
            <label>Comment:</label><br />
            <textarea value={comment} onChange={(e) => setComment(e.target.value)}></textarea><br />
            <input type="submit" value="Submit" />
          </form>
        </div>
      </div>
    </div>
  );
};

export default Review;
